-- ----------------------------
-- Table structure for oa_check_log
-- ----------------------------
DROP TABLE IF EXISTS `oa_check_log`;
CREATE TABLE `oa_check_log` (
  `id` bigint(19) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `uid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '操作人ID',
  `bizid` int(19) unsigned NOT NULL DEFAULT '0' COMMENT '业务id',
  `flag` enum('pledge','mortgage') NOT NULL DEFAULT 'pledge' COMMENT '交易类型「mortgage：抵押，pledge：质押」',
  `remark` text NOT NULL COMMENT '业务操作备注',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=47186 DEFAULT CHARSET=utf8 COMMENT='提现审核日志';

