-- ----------------------------
-- Table structure for oa_employee
-- ----------------------------
DROP TABLE IF EXISTS `oa_employee`;
CREATE TABLE `oa_employee` (
  `uid` smallint(5) unsigned NOT NULL AUTO_INCREMENT COMMENT '员工编号',
  `realname` varchar(20) NOT NULL COMMENT '姓名',
  `region` varchar(100) NOT NULL DEFAULT '1' COMMENT '所属分公司区域',
  `office` enum('salesman','wind','admin','assess') DEFAULT 'salesman' COMMENT 'salesman:业务员，assess，评估师，wind，风控，admin：管理员',
  `mobile` char(11) DEFAULT NULL COMMENT '手机号码',
  `stores` tinyint(4) DEFAULT '1' COMMENT '所属门店',
  `superior` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '所属上级',
  `is_driver` tinyint(4) unsigned DEFAULT '0' COMMENT '是否为司机',
  `status` enum('deny','allow') NOT NULL DEFAULT 'allow' COMMENT '账号是否可用[allow：允许、deny：无效]',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '添加时间',
  PRIMARY KEY (`uid`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 COMMENT='员工信息';

-- ----------------------------
-- Records of oa_employee
-- ----------------------------

-- ----------------------------
-- Table structure for oa_evaluate_bill
-- ----------------------------
DROP TABLE IF EXISTS `oa_evaluate_bill`;
CREATE TABLE `oa_evaluate_bill` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID自动递增',
  `aid` int(10) unsigned NOT NULL COMMENT '进件ID',
  `car_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '评估师给价格',
  `car_info` text NOT NULL COMMENT '评估车辆信息【扩展】',
  `explain` varchar(200) DEFAULT NULL COMMENT '评估说明',
  `status` enum('done','draft') NOT NULL DEFAULT 'draft' COMMENT '''done''：提交,''draft''：草稿',
  `uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '提交人ID',
  `created` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '提交时间',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3709 DEFAULT CHARSET=utf8;

