-- ----------------------------
-- Table structure for oa_loan
-- ----------------------------
DROP TABLE IF EXISTS `oa_loan`;
CREATE TABLE `oa_loan` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '贷款记录自增ID',
  `ln` varchar(20) NOT NULL COMMENT '贷款编号',
  `aid` int(11) NOT NULL DEFAULT '0' COMMENT '贷款申请ID',
  `loan_time` int(10) unsigned NOT NULL COMMENT '贷款时间',
  `signing_date` int(10) unsigned NOT NULL COMMENT '签约还款时间',
  `loan_period` varchar(10) NOT NULL COMMENT '贷款周期（天/周/月）',
  `sigpact_date` int(10) unsigned DEFAULT '0' COMMENT '合同签订时间',
  `employee` smallint(5) unsigned NOT NULL COMMENT '员工',
  `loan_amount` decimal(10,0) unsigned NOT NULL COMMENT '贷款金额',
  `rate` varchar(10) NOT NULL COMMENT '利率',
  `loan_status` enum('done') DEFAULT 'done' COMMENT 'done已完成',
  `car_vin` varchar(20) DEFAULT NULL COMMENT '车架号',
  `plate_no` char(7) DEFAULT NULL COMMENT '车牌号',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态[0为删除]',
  `stores` tinyint(3) unsigned DEFAULT '2' COMMENT '所属门店',
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `idx_ln` (`ln`) USING BTREE,
  KEY `fk_oa_loan_employee1_idx` (`employee`)
) ENGINE=InnoDB AUTO_INCREMENT=8149 DEFAULT CHARSET=utf8 COMMENT='放贷明细';

-- ----------------------------
-- Records of oa_loan
-- ----------------------------

-- ----------------------------
-- Table structure for oa_loan_item
-- ----------------------------
DROP TABLE IF EXISTS `oa_loan_item`;
CREATE TABLE `oa_loan_item` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键自动递增',
  `deal_flag` enum('mortgage','pledge') NOT NULL DEFAULT 'pledge' COMMENT '借款交易类型「mortgage：抵押，pledge：质押」',
  `plate_no` char(7) NOT NULL COMMENT '车牌号',
  `employee` int(10) unsigned NOT NULL COMMENT '业务ID',
  `car_vin` varchar(20) DEFAULT '' COMMENT '车辆VIN码',
  `evaluate_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '评估单ID',
  `wind_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '风控表ID',
  `status` enum('done','subpact','risktrol','deny','appraise') DEFAULT 'appraise' COMMENT 'appraise：正在评估；risktrol：正在风控给价；deny：拒绝贷款；subpact:  正在提交合同；done:完成',
  `stores` int(10) unsigned NOT NULL COMMENT '所属门店ID',
  `is_del` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '状态[0为删除]',
  `extend` text COMMENT '其他扩展【备注，说明】',
  `created` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间【进件时间】',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4320 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
-- Records of oa_loan_item
-- ----------------------------

-- ----------------------------
-- Table structure for oa_task_list
-- ----------------------------
DROP TABLE IF EXISTS `oa_task_list`;
CREATE TABLE `oa_task_list` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID自动递增',
  `aid` int(10) unsigned NOT NULL COMMENT '进件ID',
  `uid` int(10) unsigned NOT NULL COMMENT '任务归属ID',
  `type` enum('subpact','risktrol','appraise') NOT NULL DEFAULT 'appraise' COMMENT 'appraise：正在评估；risktrol：正在风控给价；subpact:  正在提交合同',
  `status` enum('wait','done') NOT NULL DEFAULT 'wait' COMMENT '''wait''：等待处理,''done''：已经处理',
  `created` int(11) NOT NULL DEFAULT '0' COMMENT '任务发送时间',
  `handle_time` int(11) NOT NULL DEFAULT '0' COMMENT '处理时间',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=395 DEFAULT CHARSET=utf8;

